'''keys: Solutions:Similar:T:S:'''from typing import Listclass Solution:        def sumKEven(self, k):        sum_ = 0        for i in range(1, k + 1):                   # convert integer to string             num = str(i)                   # Find reverse of num.             revNum = num             revNum = ''.join(reversed(revNum))                   # string(n)+rev(string(n)             strnum = num + revNum                   # convert string to integer             number = int(strnum)                   sum_ += number # summation               return sum_            # def sumKEven(self, k):    #     #     #     if k <= 0:    #         return 0            #     queue = deque()    #     for i in range(1, 10):    #         queue.append(str(i) + str(i))                #     count = 0;    #     sum_ = 0;    #     while queue:    #         number = queue.popleft()    #         sum_ += int(number)    #         count += 1    #         if count == k:    #             return sum_                #         for i in range(10):    #             length = len(number)    #             # print (queue)    #             queue.append(number[0: length//2] + str(i) + str(i) + number[length//2:])    #             # print (queue)    #     return -1    